import React from 'react';

function Header() {
  return (
    <header>
        
      <h1>SweetEst</h1>
      <nav>
        <ul>
          <li><a href="#">Մեր մասին</a></li>
          <li><a href="#">Տեսականի</a></li>
          <li><a href="#">Կապ</a></li>
        </ul>
      </nav>
    </header>
  );
}
export default Header;
